import React from 'react'

const Sidebar = () => {

    const test = [1, 2, 3];

    return (
        <div className="App-sidebar">
            <div className="mood-grid">
                {test.map(num => {
                    return (<p>x</p>)
                })}
                <div className="day"></div>
            </div>
        </div>
    )
}

export default Sidebar;
